{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "cd $CODEBUILD_SRC_DIR/infra",
        "ls -al",
        "npm install"
      ]
    },
    "build": {
      "commands": [
        "npm run build",
        "npx cdk synth -c stage=test"
      ]
    }
  },
  "artifacts": {
    "base-directory": "$CODEBUILD_SRC_DIR/infra/cdk.out",
    "files": "**/*"
  }
}
